<?php
    declare(strict_types=1);

    namespace App\Infrastructure\Persistence\User;

    use App\Domain\User\User;
    use App\Domain\User\UserNotFoundException;
    use App\Domain\User\UserRepository;

    class InMemoryUserRepository implements UserRepository
    {
        /**
         * @var User[]
         */
        private $users;

        /**
         * InMemoryUserRepository constructor.
         *
         * @param array|null $users
         */
        public function __construct(array $users = null)
        {
            $this->users = $users ?? [
                    'bilgat' => new User('bilgat', 'ebill.gates', 'Bill', 'Gates', 'bilgat@dexeus.com', 'contabilidad', 'Administritiva', $this->exampleImageB64()),
                    'stejob' => new User('stejob', 'steve.jobs', 'Steve', 'Jobs', 'stejob@dexeus.com', 'contabilidad', 'Administritiva', $this->exampleImageB64()),
                    'marzuk' => new User('marzuk', 'mark.zuckerberg', 'Mark', 'Zuckerberg', 'marzuc@dexeus.com', 'Admisiones', 'Administritiva', $this->exampleImageB64()),
                    'evaspi' => new User('evaspi', 'evan.spiegel', 'Evan', 'Spiegel', 'evaspi@dexeus.com', 'Admisiones', 'Administritiva', $this->exampleImageB64()),
                    'jacdor' => new User('jacdor', 'jack.dorsey', 'Jack', 'Dorsey', 'jacdor@dexeus.com', 'InformÃ¡tica', 'Administritiva', $this->exampleImageB64()),
                ];
        }

        /**
         * {@inheritdoc}
         */
        public function findAll(): array
        {
            unset($this->users->foto);
            return array_values($this->users);

        }

        /**
         * {@inheritdoc}
         */
        public function findUserOfId(string $id): User
        {
            if (!isset($this->users[$id])) {
                throw new UserNotFoundException();
            }

            return $this->users[$id];
        }

        private function exampleImageB64(): string
        {
            return 'data:image/png;base64,';
        }
    }
